import Article from "./Article";
import {AvatarList, AvatarListItem} from './AvatarList';
import iBreadcrumb from "./iBreadcrumb";
import {Chart, ChartCard} from "./Chart";
import {Detail, DetailCell} from './Detail';
import Emoticon from "./Emoticon";
import iGreeting from "./iGreeting";
import {iInformation, iInformationItem} from "./iInformation";
import Input from './Input';
import iLoadingBar from "./iLoadingBar";
import PageHeader from "./PageHeader";
import Profile from "./Profile";
import {iRadio, iRadioGroup} from "./iRadio";
import {Rank, RankItem} from "./Rank";
import TagGroup from "./TagGroup";
import Tips from "./Tips";
import {TodoList, TodoListItem} from './TodoList';
import {Toolbar, ToolbarItem} from './Toolbar';
import {Trend, TrendItem} from "./Trend";

let components = {
    Article,
    AvatarList,
    AvatarListItem,
    iBreadcrumb,
    Chart,
    ChartCard,
    Detail,
    DetailCell,
    Emoticon,
    iGreeting,
    iInformation,
    iInformationItem,
    Input,
    iLoadingBar,
    PageHeader,
    Profile,
    iRadio,
    iRadioGroup,
    Rank,
    RankItem,
    TagGroup,
    Tips,
    TodoList,
    TodoListItem,
    Toolbar,
    ToolbarItem,
    Trend,
    TrendItem
};

export default {
    install: (Vue) => {
        Object.keys(components).forEach(key => {
            Vue.component(key, components[key]);
        })
    }
}
